import './App.css';
import Toggle from './toggle'

function App() {
  return (
    <div className="App">
      <Toggle />
      <header className="App-header">
        <h1 className="text-3xl">Shaka Clark</h1>
        <p>Social Justice Oriented Software Engineer</p>
        <hr />
        <p>Experience</p>
        <p>MoveOn.org</p>
        <p>UpTogether</p>
        <p>The New York Times</p>
        <p>Data For Black Lives - Chicago</p>
      </header>
    </div>
  );
}

export default App;
